// ProfileDetails.js
import React from 'react';

const ProfileDetails = ({ formData, onChange, onSocialLinkChange }) => {
  const { name, bio, email, location } = formData;

  return (
    <div className="bg-gray-800 p-4 rounded-md">
      <h2 className="text-xl mb-4">Personal Information</h2>
      <form>
        <div className="mb-2">
          <label className="block mb-1">Name</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            name="name"
            value={name}
            onChange={onChange}
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">A Short Bio</label>
          <input 
            type="text" 
            className="w-full p-3 rounded-md bg-gray-700 border border-gray-600" 
            name="bio"
            value={bio}
            onChange={onChange}
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">Email</label>
          <input 
            type="email" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            name="email"
            value={email}
            onChange={onChange}
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">Location</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            name="location"
            value={location}
            onChange={onChange}
          />
        </div>
      </form>

      <h2 className="text-xl mt-4 mb-4">Social Links</h2>
      <div className="flex space-x-4">
        <button onClick={() => onSocialLinkChange('github')} className="bg-gray-700 p-2 rounded-md">GitHub</button>
        <button onClick={() => onSocialLinkChange('linkedin')} className="bg-gray-700 p-2 rounded-md">LinkedIn</button>
        <button onClick={() => onSocialLinkChange('twitter')} className="bg-gray-700 p-2 rounded-md">Twitter</button>
        <button onClick={() => onSocialLinkChange('other')} className="bg-gray-700 p-2 rounded-md">Other</button>
      </div>

      {formData.github && (
        <div className="mt-4">
          <label className="block mb-1">GitHub URL</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            value={formData.github}
            onChange={(e) => onSocialLinkChange(e, 'github')}
          />
        </div>
      )}

      {formData.linkedin && (
        <div className="mt-4">
          <label className="block mb-1">LinkedIn URL</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            value={formData.linkedin}
            onChange={(e) => onSocialLinkChange(e, 'linkedin')}
          />
        </div>
      )}

      {formData.twitter && (
        <div className="mt-4">
          <label className="block mb-1">Twitter URL</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            value={formData.twitter}
            onChange={(e) => onSocialLinkChange(e, 'twitter')}
          />
        </div>
      )}

      {formData.other && (
        <div className="mt-4">
          <label className="block mb-1">Other URL</label>
          <input 
            type="text" 
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600" 
            value={formData.other}
            onChange={(e) => onSocialLinkChange(e, 'other')}
          />
        </div>
      )}
    </div>
  );
};

export default ProfileDetails;
